tables.table_schema:
CREATE TABLE fingerprint_scans (
    id INT PRIMARY KEY,
    fingerprint_data VARCHAR(255),
    scan_date TIMESTAMP
);

CREATE TABLE fingerprint_scans (
    scan_id SERIAL PRIMARY KEY,
    scan_data BYTEA NOT NULL,
    scan_time TIMESTAMP NOT NULL
);
CREATE TABLE scan_anomalies (
    anomaly_id SERIAL PRIMARY KEY,
    scan_id INTEGER REFERENCES fingerprint_scans(scan_id),
    anomaly_type VARCHAR(50) NOT NULL,
    anomaly_description TEXT
);
CREATE TABLE scan_patterns (
    pattern_id SERIAL PRIMARY KEY,
    scan_id INTEGER REFERENCES fingerprint_scans(scan_id),
    pattern_name VARCHAR(50) NOT NULL,
    pattern_details TEXT
);

CREATE TABLE fingerprint_scans (
    id SERIAL PRIMARY KEY,
    fingerprint_data TEXT NOT NULL,
    scan_date TIMESTAMP NOT NULL,
    user_id INT NOT NULL
);

CREATE TABLE users (
    id SERIAL PRIMARY KEY,
    username VARCHAR(50) NOT NULL,
    full_name VARCHAR(100) NOT NULL,
    email VARCHAR(100) NOT NULL
);

CREATE TABLE anomalies (
    id SERIAL PRIMARY KEY,
    anomaly_type VARCHAR(50) NOT NULL,
    detected_at TIMESTAMP NOT NULL,
    details TEXT
);

CREATE TABLE patterns (
    id SERIAL PRIMARY KEY,
    pattern_name VARCHAR(50) NOT NULL,
    identified_at TIMESTAMP NOT NULL,
    details TEXT
);

CREATE TABLE access_logs (
    id SERIAL PRIMARY KEY,
    user_id INT NOT NULL,
    access_time TIMESTAMP NOT NULL,
    action VARCHAR(50) NOT NULL
);
